mapper.select:

select 

from RMINT
where RMINT_TXDATE = #{rmintTxdate,jdbcType=CHAR}
  and RMINT_BRNO = #{rmintBrno,jdbcType=CHAR}
  and RMINT_FEPNO = #{rmintFepno,jdbcType=CHAR}

mapper.delete:

delete from RMINT
where RMINT_TXDATE = #{rmintTxdate,jdbcType=CHAR}
  and RMINT_BRNO = #{rmintBrno,jdbcType=CHAR}
  and RMINT_FEPNO = #{rmintFepno,jdbcType=CHAR}
